import react from 'react'
import './CustomHeader.css'
import Particles from 'react-tsparticles'
import photo from './headerPhoto.png'


const particlesOptions={                
    fpsLimit: 120,
    interactivity: {
    events: {
        onClick: {
        enable: true,
        mode: "push",
        },
        resize: true,
    },
    modes: {
        bubble: {
        distance: 400,
        duration: 2,
        opacity: 0.8,
        size: 40,
        },
        push: {
        quantity: 4,
        },
        repulse: {
        distance: 200,
        duration: 0.4,
        },
    },
    },
    particles: {
    color: {
        value: "#ffffff",
    },
    links: {
        color: "#ffffff",
        distance: 150,
        enable: true,
        opacity: 0.5,
        width: 1,
    },
    collisions: {
        enable: true,
    },
    move: {
        direction: "none",
        enable: true,
        outMode: "bounce",
        random: false,
        speed: 2,
        straight: false,
    },
    number: {
        density: {
        enable: true,
        area: 800,
        },
        value: 100,
    },
    opacity: {
        value: 0.5,
    },
    shape: {
        type: "circle",
    },
    size: {
        random: true,
        value: 5,
    },
    },
    detectRetina: true,
}

const CustomHeader=() => {

    const particlesInit = (main) => console.log(main);    
    const particlesLoaded = (container) => console.log(container);

    return(
        <header>
           <h1>
            <span>Hellooo there!</span>
            <br />
            <span className='marginleft'>I'm</span>
            <span className='developer marginleft'>Dennis Bode</span>
           </h1>

           <div>
               <img src={photo} alt="" style={{height:500, width:'auto'}}/>
           </div>
           
           <Particles id="tsparticles" init={particlesInit} loaded={particlesLoaded} options={particlesOptions} />
        </header> 
    );
}
export default CustomHeader;
